import React from "react";
import '../css/navlink.css'

const NavigationButtons = () => {
  return (
		<nav>
			<a href='#'>Top</a>
			<a href='#'>News</a>
			<a href='#'>Favorite</a>
			<a href='#'>Donate</a>
		</nav>
	)
}

export default NavigationButtons
